import React from "react";
import logo from "./download.jpg";
import "./App.css";

class App extends React.Component{
    render(){
        return(
            <div className="App">
                                <img src={logo} className="App-logo" alt="image not found"/>
               
                                <h1>Helooo</h1>
                    <br/>
                    <input
                    type="text"
                    placeholder="enter action item"

                    />
                    <button >Add action</button>
                </div>
            
        );
    }
}
export default App;
